import React from "react";
import Pi from "../../../Pi/Pi";

function Hours({
  pis,
  pi,
  setExistingItemText,
  updateItem
}) {
  return (
    <div>
      {pis.map((item) => {
        const { nom } = item;
        console.log(item)
        return (
          <Pi key={nom} nom={item.name} prenom={item.surname} timing={item.hours} totem={item.totem} />
        );
      })}
      
    </div>
  );
}

export default Hours;
